import React from 'react'
import { useFetch } from './hooks'

function TechCrunch(){
  const news = useFetch('https://newsapi.org/v2/top-headlines?sources=techcrunch&apiKey=7153be28eea84fa1a816e6f8e9945b8c', {})
  const articles = news.articles
  console.log(articles)
  return (
    <div className="tech-crunch">
      <h3>Tech Crunch</h3>
      {
        articles.map(story => {
          const { id, source, title, description, url, urlToImage, publishedAt } = story
          return (
            <div key={ id }>
              <img src={ urlToImage } alt=""/>
              <a href='null'
                onClick={ () => window.open(url, '_blank')}>{ title }</a>
              <div>{ source.name } - { new Date(publishedAt * 1000).toLocaleString() }</div>
            </div>
          )
        })
      }
    </div>
  )
}

export default TechCrunch
